import { ThemeProvider } from 'styled-components';
import { GlobalStyles } from './Global';

// Her må du legge til egne verdier
const theme = {
  colors: {
    black: '#222831',
    grey: '#393e46',
    teal: '#00adb5',
    white: '#eeeeee',
    yellow: '#fed049',
    red: '#810034',
  },
};

const Theme = ({ children }) => (
  <>
    <GlobalStyles />
    <ThemeProvider theme={theme}>{children}</ThemeProvider>
  </>
);

export default Theme;
